/*************Name: TitleScreen ******************
 Author: Karime Saad, Tarang Khandpur
 Description: Prints the title of the Lab, along with a short desciption
				      and the names of the students involved.
Inputs: labTitle    title of the Lab/lab number
				labDesc      one line desc. of the lab
        st1FN       Student 1 First Name
				st1LN       Student 1 Last Name
				st2FN       Student 2 First Name
				st2LN       Student 2 Last Name
*/
void TitleScreen(char *labTitle, char *labDesc, char *st1FN, char *st1LN, char *st2FN, char *st2LN){
	ST7735_FillScreen(ST7735_WHITE);
	
	//Create Title Area
	ST7735_FillRect(0, 0, screenWidth, (screenHeight/3), ST7735_BLACK);
	ST7735_SetCursor(1,1);
	ST7735_DrawString(1,2, labTitle, ST7735_WHITE);
	ST7735_DrawString(2,3, labDesc, ST7735_WHITE);
	
	//Students Names	
	ST7735_DrawString(1,6, st1FN, ST7735_BLACK);
	ST7735_DrawString(2,7, st1LN, ST7735_BLACK);
	ST7735_DrawString(1,9, st2FN, ST7735_BLACK);
	ST7735_DrawString(2,10, st2LN, ST7735_BLACK);
	
	//UT Logo Code
  ST7735_DrawBitmap(88, 160, Logo, 40, 160);
}
